public class InnerWorkspaceSamlConfigurationFactory(Action<Humidifier.Grafana.WorkspaceTypes.SamlConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Grafana.WorkspaceTypes.SamlConfiguration>
{

    internal InnerWorkspaceRoleValuesFactory RoleValuesFactory { get; set; }

    internal InnerWorkspaceIdpMetadataFactory IdpMetadataFactory { get; set; }

    internal InnerWorkspaceAssertionAttributesFactory AssertionAttributesFactory { get; set; }

    protected override Humidifier.Grafana.WorkspaceTypes.SamlConfiguration Create()
    {
        var samlConfigurationResult = CreateSamlConfiguration();
        factoryAction?.Invoke(samlConfigurationResult);

        return samlConfigurationResult;
    }

    private Humidifier.Grafana.WorkspaceTypes.SamlConfiguration CreateSamlConfiguration()
    {
        var samlConfigurationResult = new Humidifier.Grafana.WorkspaceTypes.SamlConfiguration();

        return samlConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Grafana.WorkspaceTypes.SamlConfiguration result)
    {
        base.CreateChildren(result);

        result.RoleValues ??= RoleValuesFactory?.Build();
        result.IdpMetadata ??= IdpMetadataFactory?.Build();
        result.AssertionAttributes ??= AssertionAttributesFactory?.Build();
    }

} // End Of Class

